// src/components/About.js
import React from 'react';

const About = () => (
  <section id="about">
    <h2>About</h2>
    <p>I am a highly skilled software engineer with extensive expertise in C, Node.js, Python, and JavaScript. I specialize in developing scalable, efficient software solutions that address complex challenges and drive technological innovation.</p>
  </section>
);

export default About;
